const SVG = ({
  stroke,
  fill,
  width,
  icon,
  left,
  top,
  className,
  hiddenMobile,
  cursor,
  animation,
  hoverFill,
  transitionDuration,
  title,
  position,
}) => (
  <Wrapper
    viewBox={icons[icon].viewBox}
    stroke={stroke}
    fill={fill}
    svgWidth={twWidth[`${width}`]}
    left={left}
    top={top}
    className={className}
    hiddenMobile={hiddenMobile}
    cursor={cursor}
    animation={animation}
    hoverFill={hoverFill}
    position={position}
    transitionDuration={transitionDuration}
    role="presentation"
    aria-labelledby={icon}
  >
    <title id={icon} lang="en">
      {title}
    </title>
    {icons[icon].shape}
  </Wrapper>
);

export default SVG;

